import React, { useEffect, useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import './index.css';

// const data = [
//   { name: "Anom", age: 19 },
//   { name: "Megha", age: 19 },
//   { name: "Subham", age: 25 },
// ];

const TableShow = () => {
  const [data, setData] = useState([]);

  const getData = () => {
     axios.get("http://localhost:3001/show")
          .then((res)=> {
            console.log(res);
            // const myRes = res.data;
            setData(res.data);
          });
        }
useEffect(() => {
  getData();
}, [])


  return (
    <>
      <h2>Show Login</h2>
      <table>
        <thead>
          <th>Full name</th>
          <th>Email</th>
        </thead>
        <tbody>
          
            {
            data.map((e, key) => {
              return (
                <tr key={key}>
                  <td>{e.fullname}</td>
                  <td>{e.email}</td>
                </tr>
              );
            })
            }
          
        </tbody>
      </table>
      <Link className="btn" to='/'>Back To Login</Link>
    </>
  );
};

export default TableShow;
